  `tglSewa` date NOT NULL,
  `tglKembali` date NOT NULL,
  `supir` char(15) NOT NULL,
  `totalHarga` int(11) NOT NULL,
  PRIMARY KEY (`idKembali`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

